<!DOCTYPE html>
<html>

<head>
    <title>State District Selector</title>
    <link href="https://cdn.jsdelivr.net/npm/tailwindcss@latest/dist/tailwind.min.css" rel="stylesheet">
    <script src="https://cdnjs.cloudflare.com/ajax/libs/lodash.js/4.17.21/lodash.min.js"></script>
    <style>
        [id^="districts"] {
            grid-template-columns: repeat(auto-fill, 16ch);
            margin-bottom: 1rem;
        }

        #state-container>div>label,
        #state-container>div>button {
            margin-left: 1ch;
        }

        #state-container>div>div>div {
            display: flex;
            align-items: center;
        }

        #state-container>div>div>div label {
            margin-left: 0.5ch;
        }

        .state-district {
            background-color: blue;
            /* Or any other styling you want for State districts */
        }

        .house-district {
            background-color: red;
            /* Or any other styling you want for House districts */
        }

        #output {
            clip: rect(0 0 0 0);
            border: 0;
            clip-path: inset(50%);
            height: 1px;
            margin: -1px;
            overflow: hidden;
            padding: 0;
            position: absolute;
            white-space: nowrap;
            width: 1px
        }
    </style>
</head>

<body class="bg-gray-100 p-8">
    <h1 class="text-3xl mb-4">Select State Districts</h1>
    <div id="state-container" class="mb-4"></div>

    <h2 class="text-xl mb-2">Selected Districts</h2>
    <p id="summaryLabel" class="mb-2"></p>
    <button onclick="copyToClipboard()"
        class="mb-2 bg-green-500 hover:bg-green-700 text-white font-bold py-2 px-4 rounded">
        Copy to Clipboard
    </button>
    <textarea id="output" readonly class="w-full p-2 rounded border"></textarea>

    <script>
        const selectedDistricts = new Set();
        const stateDistrictCount = new Map();
        let stateDistrictData = {};
        const outputArea = document.getElementById('output');
        const debouncedUpdateOutput = _.debounce(updateOutput, 300);
        function populateData(defaultCSVData) {

            const lines = defaultCSVData.split('\n');
            for (let i = 1; i < lines.length; i++) {
                const [category, district, state] = lines[i].split(',');
                if (!stateDistrictData[state]) {
                    stateDistrictData[state] = [];
                }
                stateDistrictData[state].push(district);
            }
            populateStates(stateDistrictData);
        }

        function populateStates(stateDistrictData) {
            const stateContainer = document.getElementById('state-container');
            const fragment = document.createDocumentFragment();
            const sortedStates = Object.keys(stateDistrictData).sort();

            for (const state of sortedStates) {
                const stateDiv = document.createElement('div');
                const checkbox = document.createElement('input');
                checkbox.type = 'checkbox';
                checkbox.id = state;
                checkbox.classList = 'w-4 h-4 text-blue-600 bg-gray-100 border-gray-300 rounded focus:ring-blue-500'
                checkbox.value = state;
                checkbox.addEventListener('change', function (event) {
                    handleStateChange(event, state, stateDistrictData[state], stateDistrictData);
                });

                const label = document.createElement('label');
                label.htmlFor = state;
                label.className = 'font-mono'; // Monospaced font
                label.appendChild(document.createTextNode(state));

                // Added this new div
                const stateLabelWrapper = document.createElement('div');
                stateLabelWrapper.className = 'state-label-wrapper flex items-center gap-x-1 mb-2';

                const toggleButton = document.createElement('button');
                toggleButton.innerHTML = 'View all';
                toggleButton.className = 'text-gray-900 bg-white border rounded-lg text-sm px-5 py-2.5 mr-2 dark:bg-gray-800 dark:text-white dark:border-gray-600 dark:hover:bg-gray-700 dark:hover:border-gray-600 dark:focus:ring-gray-700 font-mono'; // Monospaced font
                toggleButton.addEventListener('click', function () {
                    toggleDistricts(state, toggleButton);
                });

                // Moved these existing lines inside the wrapper
                stateLabelWrapper.appendChild(checkbox);
                stateLabelWrapper.appendChild(label);
                stateLabelWrapper.appendChild(toggleButton);

                const districtDiv = document.createElement('div');
                districtDiv.id = `districts-${state}`;
                districtDiv.style.display = 'none';
                districtDiv.className = 'grid grid-cols-4 pl-5';

                const sortedDistricts = stateDistrictData[state].sort();
                sortedDistricts.forEach(district => {
                    const districtContainer = document.createElement('div');

                    // Determine district type and add appropriate CSS class
                    if (district.startsWith('State')) {
                        districtContainer.className = 'district-label-wrapper flex items-center gap-x-1 state-districts';
                    } else if (district.startsWith('House')) {
                        districtContainer.className = 'district-label-wrapper flex items-center gap-x-1 house-districts';
                    }

                    const districtCheckbox = document.createElement('input');
                    districtCheckbox.type = 'checkbox';
                    districtCheckbox.id = district;
                    districtCheckbox.classList = 'w-4 h-4 text-blue-600 bg-gray-100 border-gray-300 rounded focus:ring-blue-500'
                    districtCheckbox.value = district;
                    districtCheckbox.addEventListener('change', function () {
                        handleDistrictChange(this.checked, district, state);
                    });

                    const districtLabel = document.createElement('label');
                    districtLabel.htmlFor = district;
                    districtLabel.className = 'font-mono'; // Monospaced font
                    districtLabel.appendChild(document.createTextNode(district));

                    districtContainer.appendChild(districtCheckbox);
                    districtContainer.appendChild(districtLabel);

                    districtDiv.appendChild(districtContainer);
                });

                stateDiv.appendChild(stateLabelWrapper);
                stateDiv.appendChild(districtDiv);

                stateContainer.appendChild(stateDiv);
                fragment.appendChild(stateDiv);
            }
            stateContainer.appendChild(fragment);

            stateContainer.addEventListener('change', function (event) {
                if (event.target.type === 'checkbox') {
                    const state = event.target.id.split('-')[0];
                    console.log("State:", state, "Districts:", stateDistrictData[state]); // Debugging line

                    if (stateDistrictData[state]) {  // Check if it exists
                        handleStateChange(event, state, stateDistrictData[state]);
                    } else {
                        // console.warn("No data for state:", state);
                    }
                }
            });
        }

        function handleStateChange(event, state, districts, stateDistrictData) {
            const isChecked = event.target.checked;
            districts.forEach(district => {
                handleDistrictChange(isChecked, district, state);
            });

            // Update the checkboxes for the districts
            const districtDiv = document.getElementById(`districts-${state}`);
            const checkboxes = districtDiv.querySelectorAll('input[type="checkbox"]');
            checkboxes.forEach(checkbox => {
                checkbox.checked = isChecked;
            });

            // Explicitly collapse the section if the state is deselected
            if (!isChecked) {
                const toggleButton = districtDiv.parentElement.querySelector('button');
                toggleDistricts(state, toggleButton, false);
            }

            stateDistrictCount.set(state, isChecked ? districts.length : 0);
            updateSummaryLabel(stateDistrictData);

        }

        function handleDistrictChange(isChecked, district, state) {
            if (isChecked) {
                selectedDistricts.add(district);
            } else {
                selectedDistricts.delete(district);
            }
            const currentCount = stateDistrictCount.get(state) || 0;
            stateDistrictCount.set(state, isChecked ? currentCount + 1 : currentCount - 1);
            debouncedUpdateOutput();
        }

        function toggleDistricts(state, toggleButton, shouldDisplay = null) {
            const districtDiv = document.getElementById(`districts-${state}`);
            const isDisplayed = shouldDisplay !== null ? shouldDisplay : (districtDiv.style.display === 'none');
            districtDiv.style.display = isDisplayed ? 'grid' : 'none';
            toggleButton.innerHTML = isDisplayed ? 'Deselect all' : 'View all';

            // If hiding the districts, deselect them.
            if (!isDisplayed) {
                const checkboxes = districtDiv.querySelectorAll('input[type="checkbox"]');
                checkboxes.forEach(checkbox => {
                    checkbox.checked = false;
                    handleDistrictChange(false, checkbox.id, state); // Pass in the state
                });
            }
        }


        function updateOutput() {
            const sortedDistricts = Array.from(selectedDistricts).sort();
            outputArea.value = sortedDistricts.join('~');
            outputArea.style.height = 'auto';
            outputArea.style.height = (outputArea.scrollHeight) + "px";

            const copyButton = document.querySelector("button[onclick='copyToClipboard()']");
            const districtCount = sortedDistricts.length;
            copyButton.textContent = `Copy ${districtCount} District${districtCount !== 1 ? 's' : ''} to Clipboard`;

            updateSummaryLabel(stateDistrictData);

        }

        function updateSummaryLabel(stateDistrictData) {
            // Check if stateDistrictData is defined
            if (!stateDistrictData) {
                // console.warn('stateDistrictData is not defined');
                return;
            }

            let summaryText = "";
            const sortedStates = Array.from(stateDistrictCount.keys()).sort();
            sortedStates.forEach(state => {
                const count = stateDistrictCount.get(state);
                if (count > 0) {
                    // Check if stateDistrictData for the specific state is defined
                    if (stateDistrictData[state]) {
                        const totalCount = stateDistrictData[state].length;
                        summaryText += `${count} of ${totalCount} ${state} Districts<br>`;
                    } else {
                        console.warn(`No data available for state: ${state}`);
                    }
                }
            });
            summaryText = summaryText.slice(0, -4); // Remove trailing <br>
            document.getElementById('summaryLabel').innerHTML = summaryText;
        }




        function copyToClipboard() {
            outputArea.select();
            document.execCommand('copy');
        }

        document.addEventListener("DOMContentLoaded", function () {
            populateData(defaultCSVData.trim());
        });
